# Making Decisions
print("Making Decisions:")

# Each model we've looked at so far is based on creating an optimal linear
# combination of dataset features for either regression or classification.
# However, another popular model in data science for both classification
# and regression is the decision tree. It is a binary tree where each node
# of the tree decides on a particular feature of the dataset, and we descend
# to the node's left or right child depending on the feature's value.

# If a feature is boolean, we go left or right from the node depending on if
# the feature value is true or false. If a feature is numeric, we can decide
# to go left or right based on a decision boundary for the feature
# (e.g. go left if the feature value is less than 1, otherwise go right).

# The leaves of the decision tree determine the class label to predict
# (in classification) or the real number value to predict (in regression).

# In scikit-learn, we implement classification decision trees with the
# DecisionTreeClassifier object, and regression trees with the
# DecisionTreeRegressor object. Both objects are part of the tree module in
# scikit-learn.

# The code below demonstrates how to create decision trees for
# classification and regression. Each decision tree uses the fit function
# for fitting on data and labels.

clf_tree1 = tree.DecisionTreeClassifier()
reg_tree1 = tree.DecisionTreeRegressor()
clf_tree2 = tree.DecisionTreeClassifier(
  max_depth=8)  # max depth of 8
reg_tree2 = tree.DecisionTreeRegressor(
  max_depth=5)  # max depth of 5

print('Data shape: {}\n'.format(data.shape))
# Binary labels
print('Labels:\n{}\n'.format(repr(labels)))
clf_tree1.fit(data, labels)

# The max_depth keyword argument lets us manually set the maximum number of
# layers allowed in the decision tree (i.e. the tree's maximum depth). The
# default value is None, meaning that the decision tree will continue to be
# constructed until no nodes can have anymore children. Since large decision
# trees are prone to overfit data, it can be beneficial to manually set a
# maximum depth for the tree.

print("\n")
# Choosing Features
print("Choosing Features:")

# Since a decision tree makes decisions based on feature values, the
# question now becomes how we choose the features to decide on at each
# node. In general terms, we want to choose the feature value that "best"
# splits the remaining dataset at each node.

# How we define "best" depends on the decision tree algorithm that's used.
# Since scikit-learn uses the CART algorithm, we use Gini Impurity, MSE
# (mean squared error), and MAE (mean absolute error) to decide on the best
# feature at each node.

# Specifically, for classification trees we choose the feature at each node
# that minimizes the remaining dataset observations' Gini Impurity. For
# regression trees we choose the feature at each node that minimizes the
# remaining dataset observations' MSE or MAE, depending on which you choose
# to use (the default for DecisionTreeRegressor is MSE).
